from dataclasses import dataclass

@dataclass
class Triple:
    subject: str
    predicate: str
    object: str

# EVOLVE-BLOCK-START

def predict(triples: list[Triple]) -> str:
    if not triples:
        return ""

    sentences = []
    for triple in triples:
        predicate = triple.predicate
        subject = triple.subject
        object_val = triple.object

        if predicate == "alternativeName":
            sentences.append(f"{subject} is also known as {object_val}.")
        elif predicate == "creator":
            sentences.append(f"{subject} was created by {object_val}.")
        elif predicate == "fullName":
            sentences.append(f"{subject}'s full name is {object_val}.")
        elif predicate == "foundedBy":
            sentences.append(f"{subject} was founded by {object_val}.")
        elif predicate == "keyPerson":
            sentences.append(f"{object_val} is a key person at {subject}.")
        elif predicate == "city":
            sentences.append(f"{subject} is located in {object_val}.")
        elif predicate == "product":
            sentences.append(f"{subject} produces {object_val}.")
        elif predicate == "lastAired":
            sentences.append(f"{subject} last aired on {object_val}.")
        elif predicate == "starring":
            sentences.append(f"{subject} stars {object_val}.")
        elif predicate == "firstAppearanceInFilm":
            sentences.append(f"{subject} first appeared in the film {object_val}.")
        elif predicate == "voice":
            sentences.append(f"{subject} is voiced by {object_val}.")
        elif predicate == "distributor":
            sentences.append(f"{object_val} is distributed by {subject}.")
        elif predicate == "birthPlace":
            sentences.append(f"{subject} was born in {object_val}.")
        elif predicate == "nationality":
            sentences.append(f"{subject} is of {object_val} nationality.")
        elif predicate == "award":
            sentences.append(f"{subject} won the {object_val}.")
        elif predicate == "broadcastedBy":
            sentences.append(f"{subject} is broadcasted by {object_val}.")
        elif predicate == "firstAired":
            sentences.append(f"{subject} first aired on {object_val}.")
        elif predicate == "series":
            sentences.append(f"{subject} is part of the {object_val} series.")
        elif predicate == "child":
            sentences.append(f"{subject}'s child is {object_val}.")
        else:
            sentences.append(f"The {predicate} of {subject} is {object_val}.")

    return " ".join(sentences)

